INFO - 2022-02-24 23:23:40 --> get {"response":{"code":200,"message":"Success retrieve list questions"},"data":{"current_page":1,"data":[{"id":14,"question_category_id":22,"title_question":"LM01 A","is_publish":1,"section_id":1,"description":"<p><strong>SECTION 1<\/strong><br><strong>LISTENING COMPREHENSION<\/strong><br><strong>(Question 1-50)<\/strong><\/p><p><strong>Part A<\/strong><br><strong>Short Conversations<\/strong><\/p><p>Directions: In Part A, you will hear short conversations between 2 people. After each conversation, you will hear a question about the conversation. The conversations and questions will not be repeated.<\/p><p>After you hear a question, read the 4 possible answers on the screen and select the best answer by clicking on it.<\/p><p>Here is an example.<\/p><p><strong>On the recording, you hear:<\/strong><\/p><p>(man) &nbsp;That exam was just awful.<br>(woman) &nbsp;Oh, it could've been worse.<br>(narrator) &nbsp;What does the woman mean?<\/p><p><br><strong>In your test book, you read:<\/strong><\/p><p>(A) The exam was really awful.<br>(B) It was the worst exam she had ever seen.<br>(C) It couldn't have been more difficult.<br>(D) It wasn't that hard.<\/p><p>You learn from the conversation that the man thought the exam was very difficult and that the woman disagreed with the man. The best answer to the question, \"What does the woman mean?\" is (D), \"It wasn't that hard.\" Therefore, the <strong>correct choice is (D)<\/strong><br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 16:33:49","updated_at":"2022-02-24 09:37:36","category_name":"Listening Comprehension","category_code":"QUE0001"},{"id":15,"question_category_id":22,"title_question":"LM01 B","is_publish":1,"section_id":2,"description":"<p><strong>Part B<\/strong><br><strong>Long Conversations<\/strong><\/p><p><strong>Directions:<\/strong> In this part of the test, you will hear longer conversations. After each conversation, you will hear several questions. The conv