ide.<br>(A) won<br>(B) he won<br>(C) yesterday<br>(D) fortunately<\/p><p>The sentence should read. \"The president won the election by a landslide: Therefore, you should <strong>choose (A).<\/strong><br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 17:58:11","updated_at":"2022-02-24 09:50:36","category_name":"Structure & Written Expression","category_code":"QUE0002"},{"id":18,"question_category_id":23,"title_question":"LM01 E","is_publish":1,"section_id":5,"description":"<p><strong>Written Expression<\/strong><br><strong>(Error Identification)<\/strong><\/p><p>Directions: In questions 16-40, each sentence has four underlined words or phrases. The four underlined parts of the sentence are marked (A), (B), (C), and (D).<\/p><p>Identify the one underlined word or phrase that must be changed in order for the sentence to be correct. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Look at the following examples:<\/p><p><strong>The<\/strong> four <strong>string <\/strong>on a <strong>violin <\/strong>are <strong>tuned <\/strong>in fifths.<\/p><p>(A) The<br>(B) string<br>(C) violin<br>(D) tuned<\/p><p>The sentence should read, \"The four strings on a violin are tuned in fifths.\" Therefore, you should choose (B).<\/p><p><strong>Now begin work on the questions.<\/strong><\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 20:49:35","updated_at":"2022-02-24 09:50:40","category_name":"Structure & Written Expression","category_code":"QUE0002"},{"id":19,"question_category_id":24,"title_question":"LM01 F","is_publish":1,"section_id":6,"description":"<p><strong>SECTION 3<\/strong><br><strong>READING COMPREHENSION<\/strong><\/p><p>This section is designed to measure your ability to read and understand short passages similar in topic and style to those that students are likely to encounter in North American universities and colleges.<\/p><p><strong>Directions:<\/strong> In this section, you will read several passages. Each one is followed by a number of questions about it. You are to choose the one best answer, (A), (B), (C), or (D), to each question. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Answer all questions about the information in a passage on the basis of what is stated or implied in that passage.<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-24 07:25:57","updated_at":"2022-02-24 09:50:43","category_name":"Reading Comprehension","category_code":"QUE0003"}],"first_page_url":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list?page=1","from":1,"last_page":1,"last_page_url":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list?page=1","links":[{"url":null,"label":"pagination.previous","active":false},{"url":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list?page=1","label":"1","active":true},{"url":null,"label":"pagination.next","active":false}],"next_page_url":null,"path":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list","per_page":10,"prev_page_url":null,"to":6,"total":6}}
