INFO - 2022-02-24 23:23:45 --> get {"response":{"code":200,"message":"Success retrieve list questions"},"data":{"current_page":1,"data":[{"id":14,"question_category_id":22,"title_question":"LM01 A","is_publish":1,"section_id":1,"description":"<p><strong>SECTION 1<\/strong><br><strong>LISTENING COMPREHENSION<\/strong><br><strong>(Question 1-50)<\/strong><\/p><p><strong>Part A<\/strong><br><strong>Short Conversations<\/strong><\/p><p>Directions: In Part A, you will hear short conversations between 2 people. After each conversation, you will hear a question about the conversation. The conversations and questions will not be repeated.<\/p><p>After you hear a question, read the 4 possible answers on the screen and select the best answer by clicking on it.<\/p><p>Here is an example.<\/p><p><strong>On the recording, you hear:<\/strong><\/p><p>(man) &nbsp;That exam was just awful.<br>(woman) &nbsp;Oh, it could've been worse.<br>(narrator) &nbsp;What does the woman mean?<\/p><p><br><strong>In your test book, you read:<\/strong><\/p><p>(A) The exam was really awful.<br>(B) It was the worst exam she had ever seen.<br>(C) It couldn't have been more difficult.<br>(D) It wasn't that hard.<\/p><p>You learn from the conversation that the man thought the exam was very difficult and that the woman disagreed with the man. The best answer to the question, \"What does the woman mean?\" is (D), \"It wasn't that hard.\" Therefore, the <strong>correct choice is (D)<\/strong><br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 16:33:49","updated_at":"2022-02-24 09:37:36","category_name":"Listening Comprehension","category_code":"QUE0001"},{"id":15,"question_category_id":22,"title_question":"LM01 B","is_publish":1,"section_id":2,"description":"<p><strong>Part B<\/strong><br><strong>Long Conversations<\/strong><\/p><p><strong>Directions:<\/strong> In this part of the test, you will hear longer conversations. After each conversation, you will hear several questions. The conversations and questions will not be repeated.<\/p><p>After you hear a question, read the four possible answers in your test book and choose the best answer. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Remember, you are not allowed to take notes or write in your test book.<br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 16:50:21","updated_at":"2022-02-24 09:50:32","category_name":"Listening Comprehension","category_code":"QUE0001"},{"id":16,"question_category_id":22,"title_question":"LM01 C","is_publish":1,"section_id":3,"description":"<p><strong>Part C<\/strong><br><strong>Long Talks<\/strong><\/p><p><strong>Directions<\/strong>: In this part of the test, you will hear several talks. After each talk, you will hear some questions. The talks and questions will not be repeated.<\/p><p>After you hear a question, read the four possible answers in your test book and choose the best answer. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Here is an example.<\/p><p><strong>On the recording, you hear:<\/strong><\/p><p><strong>(narrator)&nbsp;<\/strong> Listen to an instructor talk to his class about painting.<\/p><p><br><strong>(man)&nbsp;<\/strong> Artist Grant Wood was a guiding force in the school of painting known as American regionalist, a style reflecting the distinctive characteristics of art from rural areas of the United States. Wood began drawing animals on the family farm at the age of three, and when he was thirty-eight, one of his paintings received a remarkable amount of public notice and acclaim. This painting, called American Gothic, is a starkly simple depiction of a serious couple starting directly out at the viewer<\/p><p><strong>Now listen to a sample question.<\/strong><\/p><p>(narrator) What style of painting is known as American regionalist?<\/p><p><strong>In your test book, you read:<\/strong><br><br>(A) Art from America's inner cities<br>(B) Art from the central region of the United States<br>(C) Art from various urban areas in the United States<br>(D) Art from rural sections of America<\/p><p>The best answer to the question \"What style of painting is known as American regionalist?\" is (D), \"Art from rural sections of America.\" Therefore, the correct choice is (D).<\/p><p>Now listen to another sample question.<\/p><p>(narrator) What is the name of Wood's most successful painting?<\/p><p>In your test book, you read:<\/p><p>&nbsp;<br>(A) American Regionalist<br>(B) The Family Farm in Iowa<br>(C) American Gothic<br>(D) A Serious Couple<\/p><p>The best answer to the question, \"What is the name of Wood's most successful painting?\" is (C), American Gothic. Therefore, the correct choice is (C).<\/p><p>Remember, you are not allowed to take notes or write in your test book.<br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 17:00:18","updated_at":"2022-02-23 21:53:50","category_name":"Listening Comprehension","category_code":"QUE0001"},{"id":17,"question_category_id":23,"title_question":"LM01 D","is_publish":1,"section_id":4,"description":"<p><strong>SECTION 2<\/strong><br><strong>STRUCTURE &amp; WRITTEN EXPRESSION<\/strong><\/p><p><strong>Structure&nbsp;<\/strong><br><strong>(sentence completion)<\/strong><\/p><p><strong>Directions<\/strong>: Questions 1-15 are<strong> incomplete sentences<\/strong>. Beneath each sentence, you will see four words or phrases. marked (A). (B). (C). and (D). Choose the one word or phrase that best completes the sentence. Then. on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen. Fill in the space so that the letter inside the oval cannot be seen.<\/p><p><strong>Look at the following example.<\/strong><\/p><p>The president ____ the election by a landslide.<br>(A) won<br>(B) he won<br>(C) yesterday<br>(D) fortunately<\/p><p>The sentence should read. \"The president won the election by a landslide: Therefore, you should <strong>choose (A).<\/strong><br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 17:58:11","updated_at":"2022-02-24 09:50:36","category_name":"Structure & Written Expression","category_code":"QUE0002"},{"id":18,"question_category_id":23,"title_question":"LM01 E","is_publish":1,"section_id":5,"description":"<p><strong>Written Expression<\/strong><br><strong>(Error Identification)<\/strong><\/p><p>Directions: In questions 16-40, each sentence has four underlined words or phrases. The four underlined parts of the sentence are marked (A), (B), (C), and (D).<\/p><p>Identify the one underlined word or phrase that must be changed in order for the sentence to be correct. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Look at the following examples:<\/p><p><strong>The<\/strong> four <strong>string <\/strong>on a <strong>violin <\/strong>are <strong>tuned <\/strong>in fifths.<\/p><p>(A) The<br>(B) string<br>(C) violin<br>(D) tuned<\/p><p>The sentence should read, \"The four strings on a violin are tuned in fifths.\" Therefore, you should choose (B).<\/p><p><strong>Now begin work on the questions.<\/strong><\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 20:49:35","updated_at":"2022-02-24 09:50:40","category_name":"Structure & Written Expression","category_code":"QUE0002"},{"id":19,"question_category_id":24,"title_question":"LM01 F","is_publish":1,"section_id":6,"description":"<p><strong>SECTION 3<\/strong><br><strong>READING COMPREHENSION<\/strong><\/p><p>This section is designed to measure your ability to read and understand short passages similar in topic and style to those that students are likely to encounter in North American universities and colleges.<\/p><p><strong>Directions:<\/strong> In this section, you will read several passages. Each one is followed by a number of questions about it. You are to choose the one best answer, (A), (B), (C), or (D), to each question. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Answer all questions about the information in a passage on the basis of what is stated or implied in that passage.<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-24 07:25:57","updated_at":"2022-02-24 09:50:43","category_name":"Reading Comprehension","category_code":"QUE0003"}],"first_page_url":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list?page=1","from":1,"last_page":1,"last_page_url":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list?page=1","links":[{"url":null,"label":"pagination.previous","active":false},{"url":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list?page=1","label":"1","active":true},{"url":null,"label":"pagination.next","active":false}],"next_page_url":null,"path":"http:\/\/156.67.218.146\/cbt-be\/api\/v1\/question\/list","per_page":10,"prev_page_url":null,"to":6,"total":6}}
