INFO - 2022-02-24 23:24:25 --> get {"response":{"code":200,"message":"Success retrieve list questions"},"data":{"current_page":1,"data":[{"id":14,"question_category_id":22,"title_question":"LM01 A","is_publish":1,"section_id":1,"description":"<p><strong>SECTION 1<\/strong><br><strong>LISTENING COMPREHENSION<\/strong><br><strong>(Question 1-50)<\/strong><\/p><p><strong>Part A<\/strong><br><strong>Short Conversations<\/strong><\/p><p>Directions: In Part A, you will hear short conversations between 2 people. After each conversation, you will hear a question about the conversation. The conversations and questions will not be repeated.<\/p><p>After you hear a question, read the 4 possible answers on the screen and select the best answer by clicking on it.<\/p><p>Here is an example.<\/p><p><strong>On the recording, you hear:<\/strong><\/p><p>(man) &nbsp;That exam was just awful.<br>(woman) &nbsp;Oh, it could've been worse.<br>(narrator) &nbsp;What does the woman mean?<\/p><p><br><strong>In your test book, you read:<\/strong><\/p><p>(A) The exam was really awful.<br>(B) It was the worst exam she had ever seen.<br>(C) It couldn't have been more difficult.<br>(D) It wasn't that hard.<\/p><p>You learn from the conversation that the man thought the exam was very difficult and that the woman disagreed with the man. The best answer to the question, \"What does the woman mean?\" is (D), \"It wasn't that hard.\" Therefore, the <strong>correct choice is (D)<\/strong><br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 16:33:49","updated_at":"2022-02-24 09:37:36","category_name":"Listening Comprehension","category_code":"QUE0001"},{"id":15,"question_category_id":22,"title_question":"LM01 B","is_publish":1,"section_id":2,"description":"<p><strong>Part B<\/strong><br><strong>Long Conversations<\/strong><\/p><p><strong>Directions:<\/strong> In this part of the test, you will hear longer conversations. After each conversation, you will hear several questions. The conversations and questions will not be repeated.<\/p><p>After you hear a question, read the four possible answers in your test book and choose the best answer. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Remember, you are not allowed to take notes or write in your test book.<br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23 16:50:21","updated_at":"2022-02-24 09:50:32","category_name":"Listening Comprehension","category_code":"QUE0001"},{"id":16,"question_category_id":22,"title_question":"LM01 C","is_publish":1,"section_id":3,"description":"<p><strong>Part C<\/strong><br><strong>Long Talks<\/strong><\/p><p><strong>Directions<\/strong>: In this part of the test, you will hear several talks. After each talk, you will hear some questions. The talks and questions will not be repeated.<\/p><p>After you hear a question, read the four possible answers in your test book and choose the best answer. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Here is an example.<\/p><p><strong>On the recording, you hear:<\/strong><\/p><p><strong>(narrator)&nbsp;<\/strong> Listen to an instructor talk to his class about painting.<\/p><p><br><strong>(man)&nbsp;<\/strong> Artist Grant Wood was a guiding force in the school of painting known as American regionalist, a style reflecting the distinctive characteristics of art from rural areas of the United States. Wood began drawing animals on the family farm at the age of three, and when he was thirty-eight, one of his paintings received a remarkable amount of public notice and acclaim. This painting, called American Gothic, is a starkly simple depiction of a serious couple starting directly out at the viewer<\/p><p><strong>Now listen to a sample question.<\/strong><\/p><p>(narrator) What style of painting is known as Ame